import react from 'react'
import {BrowserRouter, Routes, Route} from "react-router-dom"
import Categories from './Categories';
function AppRouter(){
    return (
        <BrowserRouter>
            <Routes>
                <Route exact path="/categories/:name" render={(props)=>{return(
                    <Categories name={props.match.params.name}/>)
                }} />
            </Routes>
        </BrowserRouter>
    )
}

export default AppRouter;
